def solution(numbers):
    answer = ''
    numbers.sort()
    number_list = []

    for index_numbers in numbers:
        if(len(str(index_numbers))==1):
            temp_str = str(index_numbers)+str(index_numbers)+str(index_numbers)+'_1'
            number_list.append((temp_str))
        elif(len(str(index_numbers))==2):
            temp_str = str(index_numbers) + str(index_numbers)+'_2'
            number_list.append((temp_str))
        elif (len(str(index_numbers)) == 3):
            temp_str = str(index_numbers) + str(index_numbers) + '_3'
            number_list.append((temp_str))
        else:
            temp_str = str(index_numbers) + str(index_numbers) + '_4'
            number_list.append((temp_str))

    number_list = sorted(number_list,reverse=True)

    for index_num_list in number_list:
        if index_num_list.split('_')[1] == '1':
            answer += str(index_num_list)[0]
        elif index_num_list.split('_')[1] == '2':
            answer += str(index_num_list)[0:2]
        elif index_num_list.split('_')[1] == '3':
            answer += str(index_num_list)[0:3]
        else:
            answer += str(index_num_list)[0:4]

    return str(int(answer))

